pragma solidity 0.6.12;

import "@openzeppelin/contracts/introspection/ERC165Checker.sol";
import "@openzeppelin/contracts/token/ERC1155/ERC1155.sol";
import "@openzeppelin/contracts/token/ERC1155/ERC1155Receiver.sol";
import "@openzeppelin/contracts/math/SafeMath.sol";
import "@openzeppelin/contracts/token/ERC20/IERC20.sol";
import "@openzeppelin/contracts/access/Ownable.sol";

contract GenAccess is ERC1155, ERC1155Receiver, Ownable {
    using SafeMath for uint;

    struct StakedInfo {
        uint256 numCards;
        uint256 tokenAmount;
    }

    address public genShards;
    // Base index indicates the access card type (platinum, gold, silver, etc)
    mapping(uint256 => uint256) public maxCards;
    mapping(uint256 => uint256) public cardSizes;
    mapping(uint256 => uint256) public cardSupplies;
    // Mapping of users to card type  to staked info
    mapping(address => mapping(uint256 => StakedInfo)) public stakes;
    //mapping(address => string) public telegrams;
    uint256 public cardsLength;

    bytes private constant VALIDATOR = bytes('JC');

    constructor (
        address _genShards,
        string memory _uri,
        uint256[] memory _maxCards,
        uint256[] memory _cardSizes
    ) 
        public 
        ERC1155(_uri)
    {
        require(_maxCards.length == _cardSizes.length, "GenAccess: Array length mismatch");

        genShards = _genShards;
        cardsLength = _maxCards.length;
        for (uint256 i=0; i<50; i++) {
            if (_maxCards.length == i) {
                break;
            }
            maxCards[i] = _maxCards[i];
            cardSizes[i] = _cardSizes[i];
        }
    }

    function issue(uint256 _cardType, uint256 _amount, address _to) public {
        require(_cardType < cardsLength, "GenAccess: Card type does not exist");
        require(cardSupplies[_cardType].add(_amount) <= maxCards[_cardType], "GenAccess: Max cards reached");

        IERC20(genShards).transferFrom(msg.sender, address(this), _amount.mul(cardSizes[_cardType]));
        bytes memory data;
        cardSupplies[_cardType] += _amount;
        _mint(_to, _cardType, _amount, data);
        StakedInfo storage info = stakes[msg.sender][_cardType];
        if (info.numCards == 0) {
            stakes[msg.sender][_cardType] = StakedInfo(_amount, _amount.mul(cardSizes[_cardType]));
        }
        else {
            info.numCards += _amount;
            info.tokenAmount += _amount.mul(cardSizes[_cardType]);
        }
    }

    function redeem(uint256 _cardType, uint256 _amount, address _to) public {
        require(_cardType < cardsLength, "GenAccess: Card type does not exist");

        _burn(msg.sender, _cardType, _amount);
        cardSupplies[_cardType] -= _amount;
        StakedInfo storage info = stakes[msg.sender][_cardType];
        uint256 tokensToSend = info.tokenAmount.mul(_amount).div(info.numCards);
        info.tokenAmount -= tokensToSend;
        info.numCards -= _amount;
        IERC20(genShards).transfer(_to, tokensToSend);
    }

    function addCards(uint256[] calldata _maxCards, uint256[] calldata _cardSizes) public onlyOwner {
        require(_maxCards.length == _cardSizes.length, "GenAccess: Array length mismatch");

        for (uint256 i=cardsLength; i<50; i++) {
            if (cardsLength + _maxCards.length == i) {
                break;
            }
            maxCards[i] = _maxCards[i - cardsLength];
            cardSizes[i] = _cardSizes[i - cardsLength];
        }

        cardsLength += _maxCards.length;
    }

    function setCard(uint256 _cardType, uint256 _maxCards, uint256 _cardSizes) public onlyOwner {
        maxCards[_cardType] = _maxCards;
        cardSizes[_cardType] = _cardSizes;
    }
/*
    function setTelegram(string calldata telegram) external {
        telegrams[msg.sender] = telegram;
    }*/

    /**
     * ERC1155 Token ERC1155Receiver
     */
    function onERC1155Received(address _operator, address _from, uint256 _id, uint256 _value, bytes calldata _data) override external returns(bytes4) {
        if(keccak256(_data) == keccak256(VALIDATOR)){
            return 0xf23a6e61;
        }
    }

    function onERC1155BatchReceived(address _operator, address _from, uint256[] calldata _ids, uint256[] calldata _values, bytes calldata _data) override external returns(bytes4) {
        if(keccak256(_data) == keccak256(VALIDATOR)){
            return 0xbc197c81;
        }
    }
}
